import Car from "./components/Car";
import ExpenseItem from "./components/ExpenseItem";

function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      <p>this is also visible!</p>
      <ExpenseItem />
      <Car carName={'Mustang'}/>
    </div>
  );
}
// or you can do it like this 
